import React from "react";

function TemplateBox(props) {
    return (
        <div className="description templateBox">
            <p className="h2">
                {text.split("\n").map((i, key) => {
                    return <div key={key}>{i}</div>;
                })}</p>
            <p className="details">{props.description}</p>
        </div>
    )
}

export default TemplateBox;
